the decision to share is personal, and should never, ever feel like an obligation or pressure - but if adding your voice to this part of the #metoo conversation is healing for you, i will always be here to give your words a safe, compassionate home. 
@thewordforthis 
for those of you who've shared recently, thank you so much for bearing with me as i navigate all of the changes i've been making to this platform (not to mention the beginning of the year irl, and all of the chaos that goes along with it). i'm looking forward to spending some time with your words this weekend, and will be in touch directly to make sure everything's as you want it to be.

